import { NavBar } from "./Components/NavBar/NavBar";
import './App.css'
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Home } from "./Components/Home/Home";
import { First } from "./Components/first/First";



function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<First/>}/>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
